import style from "./Nav.module.css";
import { useState } from "react";
import Ac from "@material-ui/icons/Search";
import Mi from "@material-ui/icons/Menu";
const Nav = () => {
  const [dis, changedis] = useState(false);
  const [dis2, changedis2] = useState(false);
  const [dis3, changedis3] = useState(false);
  const fun1 = () => {
    changedis(true);
    changedis3(false);
  };
  const fun2 = () => {
    changedis(false);
    changedis2(false);
    changedis3(true);
  };

  const fun3 = () => {
    changedis2(true);
    changedis3(false);
  };

  return (
    <div className={style.navmain}>
      <div id={style.navsub}>
        <div id={style.logo}>
          <p id={style.mainlabel}>
            TBB<sup id={style.sup}>TM</sup>
          </p>
        </div>
        <div id={style.searchbar}>
          <input id={style.navsearch} type="text" />

          <Ac id={style.searchicon} />
        </div>

        <div id={style.menubtn}>
          <Mi id={style.mbtn} />
        </div>

        <div id={style.navitems}>
          <div className={style["navitem1"]} onMouseEnter={fun1}>
            <p className={style.paraitem}>Products</p>
          </div>
          <div id={style.navitem2}>
            <p className={style.paraitem}>Cart</p>
          </div>
          <div id={style.navitem3}>
            <p className={style.paraitem}>User</p>
          </div>
        </div>
      </div>
      {dis && (
        <div
          className={style["onHover"]}
          onMouseHover={fun3}
          onMouseLeave={fun2}
        >
          <div className={style.tit}>
            <p className={style.titcont}>Men</p>
          </div>
          <div className={style.tit}>
            <p>Women</p>
          </div>
          <div className={style.tit}>
            <p>Kids</p>
          </div>
        </div>
      )}
      {dis2 && (
        <div
          className={style["onHover2"]}
          onMouseMoveCapture={fun3}
          onMouseLeave={fun2}
        >
          <div className={style.tit}>
            <p>Men</p>
          </div>
          <div className={style.tit}>
            <p>Women</p>
          </div>
          <div className={style.tit}>
            <p>Kids</p>
          </div>
        </div>
      )}
      {dis3 && (
        <div className={style["onHover3"]}>
          <div className={style.tit}>
            <p>Men</p>
          </div>
          <div className={style.tit}>
            <p>Women</p>
          </div>
          <div className={style.tit}>
            <p>Kids</p>
          </div>
        </div>
      )}
    </div>
  );
};

export default Nav;
